  const {apiData} = useContext(ContextGlobal);
  console.log(apiData)
  return (
    <main className="" >
      <h1>Home</h1>
      {apiData.map((dentist,index)=>(

      <div key={index} className='card-grid'>
        <p>{dentist.name}</p>
        <p>{dentist.userName}</p>
        <p>{dentist.phone}</p>
        <p>{dentist.email}</p>
        <p>{dentist.website}</p>


        {/* Donde tendr√°n que renderizar una card por cada dentista devuelto por la API.*/}
      </div>
      ))}
    </main>
  )
}

